function $getText_0(){
  var builder;
  builder = new StringBuilder_0;
  $append_0(builder.data_0, '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN"><html lang="FI">\r\n<head>\r\n<meta name="DC.language" content="FI">\r\n<meta name="DC.title" content="EUR-Lex -  - FI">\r\n<meta name="DC.subject" content="">\r\n<meta name="DC.description" content="Komission asetus (EY) N:o&nbsp;1205/2008, annettu 3&nbsp;p&auml;iv&auml;n&auml; joulukuuta 2008 , Euroopan parlamentin ja neuvoston direktiivin 2007/2/EY t&auml;yt&auml;nt&ouml;&ouml;npanosta metatiedon osalta ETA:n kannalta merkityksellinen teksti  ">\r\n<meta name="DC.type" http-equiv="Content-Type" content="text/html; charset=UTF-8">\r\n<meta name="DC.source" content="Virallinen lehti nro L 326 , 04/12/2008 s. 0012 - 0030; ">\r\n<meta name="DC.publisher" content="OPOCE">\r\n<meta name="DC.identifier" scheme="URI" content="http://europa.eu.int/eur-lex/lex/LexUriServ/LexUriServ.do?uri=CELEX::FI:HTML">\r\n<style type="text/css" media="all">  @import url(lex-screen.css); <\/style>\r\n\r\n<title>EUR-Lex - Commission Regulation (EC) No 1205/2008 of 3&nbsp;December 2008 implementing Directive 2007/2/EC of the European Parliament and of the Council as regards metadata Text with EEA relevance - FI<\/title>\r\n<\/head>\r\n<body>\r\n<p class="bglang">\r\n<a class="langue" href="http://europa.eu.int/eur-lex/lex/fi/editorial/legal_notice.htm" accesskey="8"><b>T\xE4rke\xE4 oikeudellinen huomautus<\/b><\/a>\r\n<br>\r\n<\/p>\r\n<a name="top"><\/a>\r\n<h1>Komission asetus (EY) N:o&nbsp;1205/2008, annettu 3&nbsp;p&auml;iv&auml;n&auml; joulukuuta 2008 , Euroopan parlamentin ja neuvoston direktiivin 2007/2/EY t&auml;yt&auml;nt&ouml;&ouml;npanosta metatiedon osalta ETA:n kannalta merkityksellinen teksti  <\/h1>\r\n<p><em>Virallinen lehti nro L 326 , 04/12/2008 s. 0012 - 0030<br> <\/em>\r\n<\/p>\r\n\t\t<p>Komission asetus (EY) N:o 1205/2008,<\/p><p>annettu 3 p\xE4iv\xE4n\xE4 joulukuuta 2008,<\/p><p>Euroopan parlamentin ja neuvoston direktiivin 2007/2/EY t\xE4yt\xE4nt\xF6\xF6npanosta metatiedon osalta<\/p><p>(ETA:n kannalta merkityksellinen teksti)<\/p><p>EUROOPAN YHTEIS\xD6JEN KOMISSIO, joka<\/p><p>ottaa huomioon Euroopan yhteis\xF6n perustamissopimuksen,<\/p><p>ottaa huomioon Euroopan yhteis\xF6n paikkatietoinfrastruktuurin (INSPIRE) perustamisesta 14 p\xE4iv\xE4n\xE4 maaliskuuta 2007 annetun Euroopan parlamentin ja neuvoston direktiivin 2007/2/EY [1] ja erityisesti sen 5 artiklan 4 kohdan,<\/p><p>sek\xE4 katsoo seuraavaa:<\/p><p>(1) Direktiivill\xE4 2007/2/EY s\xE4\xE4det\xE4\xE4n Euroopan yhteis\xF6n paikkatietoinfrastruktuurin perustamista koskevista yleisist\xE4 s\xE4\xE4nn\xF6ist\xE4. Koska infrastruktuurin toimivuus edellytt\xE4\xE4, ett\xE4 sen k\xE4ytt\xE4j\xE4n on voitava l\xF6yt\xE4\xE4 tietyt paikkatietoaineistot ja -palvelut ja pystytt\xE4v\xE4 arvioimaan niiden soveltuvuus tiettyyn k\xE4ytt\xF6tarkoitukseen, j\xE4senvaltioiden olisi laadittava metatietokuvaukset kyseisist\xE4 paikkatietoaineistoista ja -palveluista. Koska t\xE4llaisten metatietojen olisi oltava yhteensopivia ja k\xE4ytt\xF6kelpoisia yhteis\xF6n tasolla ja maiden rajojen yli, on tarpeen vahvistaa s\xE4\xE4nn\xF6t metatiedoille, joita k\xE4ytet\xE4\xE4n direktiivin 2007/2/EY liitteiss\xE4 I, II ja III lueteltuja paikkatietoryhmi\xE4 vastaavien paikkatietoaineistojen ja -palvelujen kuvaamiseen.<\/p><p>(2) Metatietoelementtien m\xE4\xE4rittely on tarpeen, jotta voidaan mahdollistaa metatiedon kohteena olevan tietoresurssin yksil\xF6iminen, sen luokittelu ja maantieteellisen sijainnin ja ajankohdan osoittaminen, laadun ja k\xE4ytt\xF6kelpoisuuden m\xE4\xE4rittely, paikkatietoaineistojen ja -palvelujen yhteentoimivuuss\xE4\xE4nt\xF6jen noudattamisen osoittaminen, saatavuuden ja k\xE4ytt\xF6oikeuksien rajoitusten ilmoittaminen ja resurssista vastaavan organisaation osoittaminen. Lis\xE4ksi tarvitaan metatietoelementtej\xE4, jotka liittyv\xE4t metatietoon itseens\xE4, jotta voidaan valvoa metatietojen ajantasaisuutta ja yksil\xF6id\xE4 metatiedon luomisesta ja yll\xE4pidosta vastaava organisaatio. N\xE4m\xE4 ovat ne v\xE4himm\xE4ismetatietoelementit, joita tarvitaan direktiivin 2007/2/EY noudattamiseen, mutta mik\xE4\xE4n ei est\xE4 organisaatioita kuvaamasta tietoresurssejaan laajemmin kansainv\xE4lisist\xE4 standardeista tai kulloisenkin aihealueen k\xE4yt\xE4nteist\xE4 johdettujen lis\xE4elementtien avulla. My\xF6s komissio voi laatia ja yll\xE4pit\xE4\xE4 lis\xE4ohjeita, varsinkin jos metatietojen yhteentoimivuus sit\xE4 edellytt\xE4\xE4.<\/p><p>(3) Ohjeita tarvitaan direktiivin 2007/2/EY mukaisten metatietojen kelpoisuuden toteamiseen kunkin metatietoelementin ehtojen ja oletetun esiintyvyyden suhteen eli sen m\xE4\xE4ritt\xE4miseksi, onko tietylle elementille aina l\xF6ydytt\xE4v\xE4 metatietotietueessa ilmentym\xE4, voiko ilmentymi\xE4 olla vain yksi tai voiko ilmentymi\xE4 olla useampi kuin yksi.<\/p><p>(4) Kullekin metatietoelementille on m\xE4\xE4ritelt\xE4v\xE4 arvoalue, jotta voidaan varmistaa metatietojen yhteentoimivuus monikielisess\xE4 toimintaymp\xE4rist\xF6ss\xE4; arvoalueen olisi muodostuttava vapaasta tekstist\xE4, p\xE4iv\xE4m\xE4\xE4rist\xE4, kansainv\xE4lisest\xE4 standardista johdetuista tunnuksista, kuten kielitunnuksista, rajatusta luettelosta tai sanastosta johdetuista avainsanoista taikka merkkijonoista.<\/p><p>(5) T\xE4ss\xE4 asetuksessa s\xE4\xE4detyt toimenpiteet ovat direktiivin 2007/2/EY 22 artiklalla perustetun komitean lausunnon mukaiset,<\/p><p>ON ANTANUT T\xC4M\xC4N ASETUKSEN:<\/p><p>1 artikla<\/p><p>Kohde<\/p><p>T\xE4ss\xE4 asetuksessa s\xE4\xE4det\xE4\xE4n vaatimuksista, jotka koskevat direktiivin 2007/2/EY liitteess\xE4 I, II ja III lueteltuja tietoryhmi\xE4 vastaavia paikkatietoaineistoja, paikkatietoaineistosarjoja ja paikkatietopalveluja kuvaavan metatiedon luomista ja yll\xE4pitoa.<\/p><p>2 artikla<\/p><p>M\xE4\xE4ritelm\xE4t<\/p><p>T\xE4ss\xE4 asetuksessa k\xE4ytet\xE4\xE4n direktiivin 2007/2/EY 3 artiklassa s\xE4\xE4dettyjen m\xE4\xE4ritelmien lis\xE4ksi t\xE4m\xE4n asetuksen liitteen osassa A s\xE4\xE4dettyj\xE4 m\xE4\xE4ritelmi\xE4.<\/p><p>3 artikla<\/p><p>Metatiedon luominen ja yll\xE4pito<\/p><p>Paikkatietoaineistoa, paikkatietoaineistosarjaa tai paikkatietopalvelua kuvaavan metatiedon on koostuttava liitteen osassa B kuvatuista metatietoelementeist\xE4 tai metatietoelementtien ryhmist\xE4 ja metatietoa on luotava ja sit\xE4 on yll\xE4pidett\xE4v\xE4 liitteen osassa C ja D s\xE4\xE4dettyjen s\xE4\xE4nt\xF6jen mukaisesti.<\/p><p>4 artikla<\/p><p>Voimaantulo<\/p><p>T\xE4m\xE4 asetus tulee voimaan kahdentenakymmenenten\xE4 p\xE4iv\xE4n\xE4 sen j\xE4lkeen, kun se on julkaistu Euroopan unionin virallisessa lehdess\xE4.<\/p><p>T\xE4m\xE4 asetus on kaikilta osiltaan velvoittava, ja sit\xE4 sovelletaan sellaisenaan kaikissa j\xE4senvaltioissa.<\/p><p><\/p><p>Tehty Brysseliss\xE4 3 p\xE4iv\xE4n\xE4 joulukuuta 2008.<\/p><p>Komission puolesta<\/p><p>Stavros Dimas<\/p><p>Komission j\xE4sen<\/p><p>[1] EUVL L 108, 25.4.2007, s. 1.<\/p><p>--------------------------------------------------<\/p>\r\n<h2>LIITE<br>\r\n  METATIEDON LAADINTAS\xC4\xC4NN\xD6T<br>\r\n  OSA A<\/h2>\r\n<p>M\xE4\xE4ritelm\xE4t<\/p><p>1. Sovelletaan seuraavia m\xE4\xE4ritelmi\xE4:<\/p><p>- "merkkijonolla" tarkoitetaan yksikk\xF6n\xE4 k\xE4sitelt\xE4v\xE4n\xE4 merkkijoukkona ilmaistavien metatietoelementtien arvoaluetta,<\/p><p>- "vapaalla tekstill\xE4" tarkoitetaan metatietoelementtien arvoaluetta, joka ilmaistaan yhdell\xE4 tai useammalla luonnollisella kielell\xE4,<\/p><p>- "historiatiedoilla" tarkoitetaan tietoaineiston historiaa ja elinkaarta tiedon keruusta ja hankinnasta tietoaineiston koostamisen ja johtamisen kautta nykyiseen muotoonsa, standardin EN ISO 19101 mukaisesti,<\/p><p>- "metatietoelementill\xE4" tarkoitetaan yksil\xF6it\xE4viss\xE4 olevaa metatietoyksikk\xF6\xE4, standardin EN ISO 19115 mukaisesti,<\/p><p>- "nimiavaruudella" tarkoitetaan URI-viittauksella (Uniform Resource Identifier) yksil\xF6it\xE4v\xE4\xE4 sanastoa, jonka sis\xE4lt\xE4mi\xE4 nimi\xE4 k\xE4ytet\xE4\xE4n XML-asiakirjoissa (Extensible Markup Language) elementtien ja attribuuttien nimin\xE4,<\/p><p>- "laadulla" tarkoitetaan niist\xE4 tuotteen ominaisuuksista muodostuvaa kokonaisuutta, joihin perustuu tuotteen kyky t\xE4ytt\xE4\xE4 sille asetetut vaatimukset ja siihen kohdistuvat odotukset, standardin EN ISO 19101 mukaisesti,<\/p><p>- "resurssilla" tarkoitetaan tietoresurssia, joka sis\xE4lt\xE4\xE4 suoran tai ep\xE4suoran viittauksen tiettyyn paikkaan tai maantieteelliseen alueeseen,<\/p><p>- "paikkatietoaineistosarjalla" tarkoitetaan sellaisten paikkatietoaineistojen joukkoa, joilla on sama tietotuoteseloste.<\/p><p>2. Paikkatietoaineiston kelpoisuudella viitataan:<\/p><p>- kohdealueeseen ja ajanjaksoon, jota tieto koskee,<\/p><p>- siihen, onko tieto tarkastettu jonkin mittaus-, luotettavuus- tai muun vaatimusstandardin mukaisesti,<\/p><p>- siihen, miss\xE4 m\xE4\xE4rin tieto soveltuu kyseiseen k\xE4ytt\xF6tarkoitukseen, tai<\/p><p>- soveltuvin osin paikkatietoaineiston oikeudelliseen merkityksellisyyteen.<\/p>\r\n<h2>OSA B<br>\r\n  Metatietoelementit<\/h2>\r\n<h3><a id="identification" name="identification">1<\/a>. YKSIL\xD6IMINEN<\/h3>\r\n<p>Seuraavat metatietoelementit ovat pakollisia:<\/p>\r\n<h4><a id="resourceTitle" name="resourceTitle">1.1.<\/a> Resurssin nimi<\/h4>\r\n<p>Luonnehtiva ja usein yksil\xF6iv\xE4 nimi, jolla resurssi tunnetaan.<\/p><p>T\xE4m\xE4 metatietoelementin arvoalue koostuu vapaasta tekstist\xE4.<\/p>\r\n<h4><a id="resourceAbstract" name="resourceAbstract">1.2.<\/a> Resurssin tiivistelm\xE4<\/h4>\r\n<p>Resurssin sis\xE4lt\xF6\xE4 kuvaileva tiivistelm\xE4.<\/p><p>T\xE4m\xE4 metatietoelementin arvoalue koostuu vapaasta tekstist\xE4.<\/p>\r\n<h4><a id="resourceType" name="resourceType">1.3.<\/a> Resurssin tyyppi<\/h4>\r\n<p>Metatiedon kohteena olevan resurssin tyyppi.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue m\xE4\xE4ritell\xE4\xE4n kohdassa D.1.<\/p>\r\n<h4><a id="resourceLocator" name="resourceLocator">1.4.<\/a> Resurssin osoite<\/h4>\r\n<p>Ilmaisee linkin (linkit) resurssiin ja/tai resurssia koskevaan lis\xE4tietoon.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue koostuu merkkijonoista, yleens\xE4 URL-osoitteista (Uniform Resource Locator).<\/p>\r\n<h4><a id="resourceIdentifier" name="resourceIdentifier">1.5.<\/a> Yksil\xF6iv\xE4 resurssitunniste<\/h4>\r\n<p>Yksik\xE4sitteinen tunniste, joka yksil\xF6i resurssin.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue koostuu pakollisista merkkijonotunnuksista, jotka yleens\xE4 antaa tiedon omistaja, sek\xE4 merkkijonomuotoisesta nimiavaruudesta, joka yksil\xF6i resurssitunnisteen asiayhteyden (esimerkiksi tiedon omistajan).<\/p>\r\n<h4><a id="coupledResource" name="coupledResource">1.6.<\/a> Liit\xE4nn\xE4isresurssi<\/h4>\r\n<p>Jos resurssi on paikkatietopalvelu, t\xE4m\xE4 metatietoelementti yksil\xF6i soveltuvin osin palvelun kohteena olevat paikkatietoaineistot niiden URI-tunnisteiden avulla.<\/p><p>T\xE4m\xE4 metatietoelementin arvoalue koostuu pakollisista merkkijonotunnuksista, jotka yleens\xE4 antaa tiedon omistaja, sek\xE4 merkkijonomuotoisesta nimiavaruudesta, joka yksil\xF6i tunnuksen asiayhteyden (esimerkiksi tiedon omistajan).<\/p>\r\n<h4><a id="resourceLanguage" name="resourceLanguage">1.7.<\/a> Resurssin kieli<\/h4>\r\n<p>Resurssissa esiintyv\xE4 kieli.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue koostuu standardissa ISO 639-2 m\xE4\xE4ritellyist\xE4 kielist\xE4.<\/p>\r\n<h3><a id="classification" name="classification">2.<\/a> PAIKKATIETOJEN JA PAIKKATIETOPALVELUJEN \r\n  LUOKITTELU<\/h3>\r\n<h4><a id="topicCategory" name="topicCategory">2.1.<\/a> Aiheluokka<\/h4>\r\n<p>Aiheluokka ilmaisee yl\xE4tason luokittelun ja auttaa paikkatietoresurssien ryhmittelyss\xE4 ja aihehaussa.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue m\xE4\xE4ritell\xE4\xE4n kohdassa D.2.<\/p>\r\n<h4><a id="serviceType" name="serviceType">2.2.<\/a> Paikkatietopalvelutyyppi<\/h4>\r\n<p>T\xE4m\xE4 luokittelu helpottaa paikkatietopalvelujen hakemista. Kukin palvelu luokitellaan ainoastaan yhteen luokkaan.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue m\xE4\xE4ritell\xE4\xE4n kohdassa D.3.<\/p>\r\n  \r\n<h3><a id="keyword" name="keyword"><\/a>3. AVAINSANA<\/h3>\r\n  <p>Jos resurssi on paikkatietopalvelu, on ilmoitettava v\xE4hint\xE4\xE4n yksi avainsana kohdasta D.4.<\/p><p>Jos resurssi on paikkatietoaineisto tai paikkatietoaineistosarja, on ilmoitettava v\xE4hint\xE4\xE4n yksi GEMET-sanaston (General Environmental Multi-lingual Thesaurus) avainsana, joka kuvaa kyseist\xE4 paikkatiedon aihetta direktiivin 2007/2/EY liitteen I, II tai III mukaisesti.<\/p><p>Kustakin avainsanasta on annettava seuraavat metatietoelementit:<\/p>\r\n  \r\n<h4><a id="keywordValue" name="keywordValue"><\/a>3.1 Avainsanan arvo<\/h4>\r\n  <p>Avainsanan arvona toimii aihetta kuvaava yleinen sana, j\xE4sennetty asiasana tai lause. Aiheluokkajaottelu on liian ylimalkainen tarkempiin hakuihin, joten avainsanojen avulla voi t\xE4sment\xE4\xE4 tekstihakuja ja tehd\xE4 rakenteisia avainsanahakuja.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue koostuu vapaasta tekstist\xE4.<\/p>\r\n  \r\n<h4><a id="vocabulary" name="vocabulary"><\/a>3.2 L\xE4hteen\xE4 oleva rajattu sanasto<\/h4>\r\n  <p>Jos avainsanan arvo on per\xE4isin rajatusta sanastosta (asiasanastosta, ontologiasta), esimerkiksi GEMETist\xE4, on annettava viittaus kyseiseen sanastoon.<\/p><p>Viittauksen on sis\xE4llett\xE4v\xE4 ainakin sanaston nimi ja viitep\xE4iv\xE4m\xE4\xE4r\xE4 (julkaisup\xE4iv\xE4, viimeisimm\xE4n p\xE4ivityksen ajankohta tai luomisajankohta).<\/p>\r\n  \r\n<h3><a id="geographic" name="geographic"><\/a>4. MAANTIETEELLINEN SIJAINTI<\/h3>\r\n  <p>Direktiivin 2007/2/EY 11 artiklan 2 kohdan e alakohdassa tarkoitettu maantieteellinen sijainti ilmaistaan metatietoelementtin\xE4 sijaintia rajaavalla suorakaiteella.<\/p>\r\n  \r\n<h4><a id="boundingBox" name="boundingBox"><\/a>4.1 Sijaintia rajaava suorakaide<\/h4>\r\n  <p>T\xE4m\xE4 kuvaa rajaavan suorakaiteen avulla resurssin sijainnillista kattavuutta.<\/p><p>Rajaava suorakaide m\xE4\xE4ritell\xE4\xE4n l\xE4ntisen tai it\xE4isen pituuspiirin sek\xE4 etel\xE4isen tai pohjoisen leveyspiirin avulla desimaaliasteina v\xE4hint\xE4\xE4n kahden desimaalin tarkkuudella.<\/p>\r\n  \r\n<h3><a id="temporal" name="temporal"><\/a>5. AIKAVIITE<\/h3>\r\n  <p>T\xE4ll\xE4 metatietoelementill\xE4 t\xE4ytet\xE4\xE4n tiedon ajalliseen ulottuvuuteen liittyv\xE4 vaatimus, johon viitataan direktiivin 2007/2/EY 8 artiklan 2 kohdan d kohdassa. Aikaviitteen\xE4 on annettava ainakin yksi kohdissa 5.1\u20135.4 tarkoitetuista metatietoelementeist\xE4.<\/p><p>Kohdissa 5.1\u20135.4 tarkoitettujen metatietoelementtien arvoalue koostuu p\xE4iv\xE4m\xE4\xE4rist\xE4. Kunkin p\xE4iv\xE4m\xE4\xE4r\xE4n on oltava sidoksissa tiettyyn aikaviitej\xE4rjestelm\xE4\xE4n ja se on ilmaistava kyseisen j\xE4rjestelm\xE4n mukaisesti. Oletusviitej\xE4rjestelm\xE4n\xE4 k\xE4ytet\xE4\xE4n gregoriaanista kalenteria, jossa p\xE4iv\xE4m\xE4\xE4r\xE4t ilmaistaan standardin ISO 8601 mukaisesti.<\/p>\r\n  \r\n<h4><a id="temporalExtent" name="temporalExtent"><\/a>5.1 Ajallinen kattavuus<\/h4>\r\n  <p>Ajallinen kattavuus tarkoittaa ajanjaksoa, jota resurssin sis\xE4lt\xF6 koskee. Ajanjakso voidaan ilmaista jollakin seuraavista:<\/p><p>- yksitt\xE4inen p\xE4iv\xE4m\xE4\xE4r\xE4,<\/p><p>- aikav\xE4li ilmaistuna alkup\xE4iv\xE4m\xE4\xE4r\xE4n ja loppup\xE4iv\xE4m\xE4\xE4r\xE4n avulla,<\/p><p>- yhdistelm\xE4 yksitt\xE4isi\xE4 p\xE4iv\xE4m\xE4\xE4ri\xE4 ja aikav\xE4lej\xE4.<\/p>\r\n  \r\n<h4><a id="publicationDate" name="publicationDate"><\/a>5.2 Julkaisup\xE4iv\xE4<\/h4>\r\n  <p>Resurssin julkaisup\xE4iv\xE4m\xE4\xE4r\xE4, jos se on tiedossa, tai voimaantulop\xE4iv\xE4. Julkaisup\xE4iv\xE4m\xE4\xE4ri\xE4 voi olla useampia kuin yksi.<\/p>\r\n  \r\n<h4><a id="revisionDate" name="revisionDate"><\/a>5.3 Viimeisin p\xE4ivitysajankohta<\/h4>\r\n  <p>Resurssin viimeisin p\xE4ivitysajankohta, jos resurssia on p\xE4ivitetty. N\xE4it\xE4 ajankohtia voi olla vain yksi.<\/p>\r\n  \r\n<h4><a id="creationDate" name="creationDate"><\/a>5.4 Luontiajankohta<\/h4>\r\n  <p>P\xE4iv\xE4m\xE4\xE4r\xE4, jona resurssi on luotu. Luontiajankohtia voi olla vain yksi.<\/p>\r\n  \r\n<h3><a id="quality" name="quality"><\/a>6. LAATU JA K\xC4YTT\xD6KELPOISUUS<\/h3>\r\n  <p>Direktiivin 2007/2/EY 5 artiklan 2 kohdassa ja 11 artiklan 2 kohdassa tarkoitettua paikkatiedon laatua ja k\xE4ytt\xF6kelpoisuutta kuvataan seuraavilla metatietoelementeill\xE4:<\/p>\r\n  \r\n<h4><a id="lineage" name="lineage"><\/a>6.1 Historiatieto<\/h4>\r\n  <p>Selitys paikkatietoaineiston luontiprosessista ja/tai yleisest\xE4 laadukkuudesta. Voi tarvittaessa sis\xE4lt\xE4\xE4 maininnan tiedon k\xE4ytt\xF6kelpoisuuden todentamisesta tai laadunvarmistuksesta, version virallisuudesta (jos versioita on olemassa useampia) tai oikeudellisesta merkitsevyydest\xE4.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue koostuu vapaasta tekstist\xE4.<\/p>\r\n  \r\n<h4><a id="spatialResolution" name="spatialResolution"><\/a>6.2 Erotuskyky<\/h4>\r\n  <p>Viittaa tietoaineiston sijainnilliseen yksityiskohtaisuuteen. Ilmaistaan joukkona (0\u2026*) n\xE4ytepisteiden v\xE4lisi\xE4 et\xE4isyyksi\xE4 (tyypillisesti hila- ja kuvamuotoisen tiedon yhteydess\xE4) tai mittakaavavastaavuuksia (tyypillisesti kartoissa tai kartoista johdetun tiedon yhteydess\xE4).<\/p><p>Mittakaava ilmaistaan yleens\xE4 mittakaavan nimitt\xE4j\xE4\xE4 ilmaisevalla kokonaisluvulla.<\/p><p>N\xE4ytepisteiden v\xE4linen et\xE4isyys ilmaistaan pituusmittayksikk\xF6\xF6n liitetyll\xE4 numeerisella arvolla.<\/p>\r\n  \r\n<h3><a id="conformity" name="conformity"><\/a>7. S\xC4\xC4NT\xD6JENMUKAISUUS<\/h3>\r\n  <p>Direktiivin 2007/2/EY 5 artiklan 2 kohdan a alakohdassa ja 11 artiklan 2 kohdan d alakohdassa tarkoitettua s\xE4\xE4nt\xF6jenmukaisuutta ja s\xE4\xE4nt\xF6jenmukaisuuden astetta suhteessa kyseisen direktiivin 7 artiklan 1 kohdan nojalla vahvistettuihin s\xE4\xE4nt\xF6ihin kuvataan seuraavilla metatietoelementeill\xE4:<\/p>\r\n  \r\n<h4><a id="specification" name="specification"><\/a>7.1 M\xE4\xE4rittely<\/h4>\r\n  <p>Viittaus direktiivin 2007/2/EY 7 artiklan 1 kohdan nojalla vahvistettuun s\xE4\xE4nn\xF6st\xF6\xF6n tai muuhun eritelm\xE4\xE4n, jonka vaatimukset kyseinen resurssi');
  $append_0(builder.data_0, ' t\xE4ytt\xE4\xE4.<\/p><p>Resurssi voi t\xE4ytt\xE4\xE4 useamman kuin yhden direktiivin 2007/2/EY 7 artiklan 1 kohdan nojalla vahvistetun s\xE4\xE4nn\xF6st\xF6n tai muun eritelm\xE4n vaatimukset.<\/p><p>Viittauksen on sis\xE4llett\xE4v\xE4 ainakin direktiivin 2007/2/EY 7 artiklan 1 kohdan nojalla vahvistetun s\xE4\xE4nn\xF6st\xF6n tai muun eritelm\xE4n nimi ja viitep\xE4iv\xE4m\xE4\xE4r\xE4 (julkaisup\xE4iv\xE4, viimeisimm\xE4n p\xE4ivityksen ajankohta tai luomisajankohta).<\/p>\r\n  \r\n<h4><a id="degree" name="degree"><\/a>7.2 S\xE4\xE4nt\xF6jenmukaisuusaste<\/h4>\r\n  <p>Kuvaa sit\xE4, miss\xE4 m\xE4\xE4rin resurssi t\xE4ytt\xE4\xE4 direktiivin 2007/2/EY 7 artiklan 1 kohdan nojalla vahvistetun s\xE4\xE4nn\xF6st\xF6n tai muun spesifikaation vaatimukset.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue m\xE4\xE4ritell\xE4\xE4n kohdassa D.5.<\/p>\r\n  \r\n<h3><a id="constraint" name="constraint"><\/a>8. SAATAVUUS- JA K\xC4YTT\xD6RAJOITUKSET<\/h3>\r\n  <p>Saatavuus- ja k\xE4ytt\xF6rajoitukset ilmaistaan jommallakummalla tai molemmilla seuraavista:<\/p><p>- saatavuus- ja k\xE4ytt\xF6ehdot (8.1)<\/p><p>- julkisen saatavuuden rajoitukset (8.2).<\/p>\r\n  \r\n<h4><a id="condition" name="condition"><\/a>8.1 Saatavuus- ja k\xE4ytt\xF6ehdot<\/h4>\r\n  <p>T\xE4m\xE4 metatietoelementti ilmaisee paikkatietoaineiston tai -palvelun saatavuus- ja k\xE4ytt\xF6ehdot ja tarvittaessa vastaavat maksut direktiivin 2007/2/EY 5 artiklan 2 kohdan b alakohdassa ja 11 artiklan 2 kohdan f alakohdassa edellytetyn mukaisesti.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue koostuu vapaasta tekstist\xE4.<\/p><p>Elementille on annettava arvo. Jos resurssin saatavuuteen ja k\xE4ytt\xF6\xF6n ei sovelleta ehtoja, arvoksi annetaan "ei k\xE4ytt\xF6ehtoja". Jos ehdot eiv\xE4t ole tiedossa, arvoksi annetaan "k\xE4ytt\xF6ehdot tuntemattomat".<\/p><p>Elementin on sis\xE4llett\xE4v\xE4 tietoa my\xF6s mahdollisista resurssin k\xE4yt\xF6st\xE4 peritt\xE4vist\xE4 maksuista tai viittaus URL-osoitteeseen, josta saa tietoa maksuista.<\/p>\r\n  \r\n<h4><a id="limitation" name="limitation"><\/a>8.2 Julkisen saatavuuden rajoitukset<\/h4>\r\n  <p>Jos j\xE4senvaltio on rajoittanut paikkatietoaineiston tai -palvelun julkista saatavuutta direktiivin 2007/2/EY 13 artiklan nojalla, t\xE4ss\xE4 metatietoelementiss\xE4 annetaan tietoa rajoituksista ja niiden syist\xE4.<\/p><p>Ellei julkista saatavuutta ole rajoitettu, metatietoelementiss\xE4 on mainittava my\xF6s t\xE4st\xE4.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue koostuu vapaasta tekstist\xE4.<\/p>\r\n  \r\n<h3><a id="organization" name="organization"><\/a>9. PAIKKATIETOAINEISTOJEN JA \r\n  -PALVELUJEN TUOTTAMISESTA, HALLINNASTA, YLL\xC4PIDOSTA JA JAKELUSTA VASTAAVAT ORGANISAATIOT<\/h3>\r\n  <p>Direktiivin 2007/2/EY 5 artiklan 2 kohdan d alakohdassa ja 11 artiklan 2 kohdan g alakohdassa asetettujen vaatimusten t\xE4ytt\xE4miseksi ilmoitetaan seuraavat kaksi metatietoelementti\xE4:<\/p>\r\n  \r\n<h4><a id="party" name="party"><\/a>9.1 Vastuutaho<\/h4>\r\n  <p>Resurssin tuottamisesta, hallinnasta, yll\xE4pidosta ja jakelusta vastaavan tahon kuvaus.<\/p><p>Kuvauksen on sis\xE4llett\xE4v\xE4:<\/p><p>- organisaation nimi vapaan tekstin muodossa,<\/p><p>- s\xE4hk\xF6postiosoite merkkijonona.<\/p>\r\n  \r\n<h4><a id="role" name="role"><\/a>9.2 Vastuutahon rooli<\/h4>\r\n  <p>Vastuullisen organisaation rooli resurssin suhteen.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue m\xE4\xE4ritell\xE4\xE4n kohdassa D.6.<\/p>\r\n  \r\n<h3><a id="metadata" name="metadata"><\/a>10. METATIETOA KOSKEVAT METATIEDOT<\/h3>\r\n  <p>Direktiivin 2007/2/EY 5 artiklan 1 kohdassa asetettujen vaatimusten t\xE4ytt\xE4miseksi ilmoitetaan seuraavat metatietoelementit:<\/p>\r\n  \r\n<h4><a id="contact" name="contact"><\/a>10.1 Metatiedosta vastaava taho<\/h4>\r\n  <p>Metatiedon luomisesta ja yll\xE4pidosta vastaavan tahon kuvaus.<\/p><p>Kuvauksen on sis\xE4llett\xE4v\xE4:<\/p><p>- organisaation nimi vapaan tekstin muodossa,<\/p><p>- s\xE4hk\xF6postiosoite merkkijonona.<\/p>\r\n  \r\n<h4><a id="metadata_date" name="metadata_date"><\/a>10.2 Metatiedon p\xE4iv\xE4ys<\/h4>\r\n  <p>Ajankohta, jona metatietotietue on luotu tai jona sit\xE4 on p\xE4ivitetty.<\/p><p>P\xE4iv\xE4m\xE4\xE4r\xE4 ilmaistaan standardin ISO 8601 mukaisesti.<\/p>\r\n  \r\n<h4><a id="metadata_language" name="metadata_language"><\/a>10.3 Metatiedon kieli<\/h4>\r\n  <p>Luonnollinen kieli, jolla metatietoelementit on ilmaistu.<\/p><p>T\xE4m\xE4n metatietoelementin arvoalue koostuu yhteis\xF6n virallisista kielist\xE4 ilmaistuina standardin ISO 639-2 mukaisesti.<\/p>\r\n<h2>OSA C<br>\r\n  Ohjeet metatietoelementtien kerrannaisuudesta ja ehdollisuuksista<\/h2>\r\n<p>Resurssia kuvaavan metatiedon on sis\xE4llett\xE4v\xE4 paikkatietoaineiston tai paikkatietoaineistosarjan osalta taulukossa 1 luetellut metatietoelementit ja metatietoelementtien ryhm\xE4t sek\xE4 paikkatietopalvelun osalta taulukossa 2 luetellut metatietoelementit ja metatietoelementtien ryhm\xE4t.<\/p><p>Metatietoelementtien ja niiden ryhmien on t\xE4ytett\xE4v\xE4 taulukoissa 1 ja 2 asetetut kerrannaisuusehdot ja niiden ehdollisuudet.<\/p><p>Ellei tietty metatietoelementti ole ehdollinen, se on pakollinen.<\/p><p>Taulukot sis\xE4lt\xE4v\xE4t seuraavat tiedot:<\/p><p>- ensimm\xE4inen sarake sis\xE4lt\xE4\xE4 viittauksen liitteen osassa B olevaan kohtaan, jossa metatietoelementti tai metatietoelementtien ryhm\xE4 m\xE4\xE4ritell\xE4\xE4n,<\/p><p>- toinen sarake sis\xE4lt\xE4\xE4 metatietoelementin tai metatietoelementtien ryhm\xE4n nimen,<\/p><p>- kolmas sarake osoittaa metatietoelementin kerrannaisuuden. Kerrannaisuus ilmaistaan UML-merkint\xE4tavan mukaisesti:<\/p><p>- 1 tarkoittaa, ett\xE4 tulosjoukossa saa esiinty\xE4 ainoastaan yksi t\xE4m\xE4n metatietoelementin ilmentym\xE4,<\/p><p>- 1..* tarkoittaa, ett\xE4 tulosjoukossa on esiinnytt\xE4v\xE4 ainakin yksi t\xE4m\xE4n metatietoelementin ilmentym\xE4,<\/p><p>- 0..1 tarkoittaa, ett\xE4 metatietoelementin esiintyminen tulosjoukossa on ehdollista ja ilmentymi\xE4 voi olla vain yksi,<\/p><p>- 0..* tarkoittaa, ett\xE4 metatietoelementin esiintyminen tulosjoukossa on ehdollista ja ilmentymi\xE4 voi olla yksi tai useampia,<\/p><p>- kun kerrannaisuus on 0..1 tai 0..*, esitetty ehto m\xE4\xE4rittelee sen, milloin metatietoelementti on pakollinen,<\/p><p>- nelj\xE4s sarake sis\xE4lt\xE4\xE4 ehdon, jos elementin kerrannaisuus ei koske kaikkia resurssityyppej\xE4. Muissa tapauksissa kaikki elementit ovat pakollisia.<\/p>\r\n<h3>Taulukko 1<\/h3>\r\n<h3>Paikkatietoaineiston tai paikkatietoaineistosarjan metatiedot<\/h3>\r\n<p>Viite | Metatietoelementti | Kerrannaisuus | Ehto |<\/p><p>1.1 | Resurssin nimi | 1 | |<\/p><p>1.2 | Resurssin tiivistelm\xE4 | 1 | |<\/p><p>1.3 | Resurssin tyyppi | 1 | |<\/p><p>1.4 | Resurssin osoite | 0..* | Pakollinen, jos k\xE4yt\xF6ss\xE4 on URL-osoite, josta saa lis\xE4tietoa resurssista ja/tai sen saatavuuteen liittyvi\xE4 palveluja. |<\/p><p>1.5 | Yksil\xF6iv\xE4 resurssitunniste | 1..* | |<\/p><p>1.7 | Resurssin kieli | 0..* | Pakollinen, jos resurssi sis\xE4lt\xE4\xE4 tekstimuotoista informaatiota. |<\/p><p>2.1 | Aiheluokka | 1..* | |<\/p><p>3 | Avainsana | 1..* | |<\/p><p>4.1 | Sijaintia rajaava suorakaide | 1..* | |<\/p><p>5 | Aikaviite | 1..* | |<\/p><p>6.1 | Historiatieto | 1 | |<\/p><p>6.2 | Erotuskyky | 0..* | Pakollinen, jos tietoaineistolle tai tietoaineistosarjalle voidaan m\xE4\xE4ritell\xE4 mittakaava tai n\xE4ytetiheys. |<\/p><p>7 | S\xE4\xE4nt\xF6jenmukaisuus | 1..* | |<\/p><p>8.1 | Saatavuus- ja k\xE4ytt\xF6ehdot | 1..* | |<\/p><p>8.2 | Julkisen saatavuuden rajoitukset | 1..* | |<\/p><p>9 | Vastuutaho | 1..* | |<\/p><p>10.1 | Metatiedosta vastaava taho | 1..* | |<\/p><p>10.2 | Metatiedon p\xE4iv\xE4ys | 1 | |<\/p><p>10.3 | Metatiedon kieli | 1 | |<\/p>\r\n<h3>Taulukko 2<\/h3>\r\n<h3>Paikkatietopalvelujen metatiedot<\/h3>\r\n<p>Viite | Metatietoelementti | Kerrannaisuus | Ehto |<\/p><p>1.1 | Resurssin nimi | 1 | |<\/p><p>1.2 | Resurssin tiivistelm\xE4 | 1 | |<\/p><p>1.3 | Resurssin tyyppi | 1 | |<\/p><p>1.4 | Resurssin osoite | 0..* | Pakollinen, jos palveluun on olemassa linkki. |<\/p><p>1.6 | Liit\xE4nn\xE4isresurssi | 0..* | Pakollinen, jos palvelun k\xE4ytt\xE4miin tietoaineistoihin on olemassa linkki. |<\/p><p>2.2 | Paikkatietopalvelutyyppi | 1 | |<\/p><p>3 | Avainsana | 1..* | |<\/p><p>4.1 | Sijaintia rajaava suorakaide | 0\u2026* | Pakollinen palveluille, joilla on selke\xE4 sijainnillinen kattavuus. |<\/p><p>5 | Aikaviite | 1..* | |<\/p><p>6.2 | Erotuskyky | 0..* | Pakollinen, jos sijaintitiedon erotuskyky\xE4 on palvelussa rajoitettu. |<\/p><p>7 | S\xE4\xE4nt\xF6jenmukaisuus | 1..* | |<\/p><p>8.1 | Saatavuus- ja k\xE4ytt\xF6ehdot | 1..* | |<\/p><p>8.2 | Julkisen saatavuuden rajoitukset | 1..* | |<\/p><p>9 | Vastuutaho | 1..* | |<\/p><p>10.1 | Metatiedoista vastaava taho | 1..* | |<\/p><p>10.2 | Metatiedon p\xE4iv\xE4ys | 1 | |<\/p><p>10.3 | Metatiedon kieli | 1 | |<\/p>\r\n<h2>OSA D<br>\r\n  Arvoalueet<\/h2>\r\n<p>Kohdissa D.1\u2013D.6 kuvattuja arvoalueita on k\xE4ytett\xE4v\xE4 osassa B olevan metatietoelementtien kuvauksen mukaisesti ja noudattaen osan C taulukoissa 1 ja 2 esitettyj\xE4 kerrannaisuuss\xE4\xE4nt\xF6j\xE4.<\/p><p>Kunkin alueen kukin arvo on m\xE4\xE4ritelty seuraavin tiedoin:<\/p><p>- numerotunnus,<\/p><p>- luonnollisella kielell\xE4 oleva nimi, joka voidaan k\xE4\xE4nt\xE4\xE4 Euroopan yhteis\xF6n eri kielille,<\/p><p>- kielineutraali nimi tietokonek\xE4ytt\xF6\xF6n (sulkeissa oleva merkkijono),<\/p><p>- mahdollinen kuvaus tai m\xE4\xE4ritelm\xE4.<\/p>\r\n<h3>1. RESURSSIN TYYPPI<\/h3>\r\n<p>1.1 Paikkatietoaineistosarja (series)<\/p><p>1.2 Paikkatietoaineisto (dataset)<\/p><p>1.3 Paikkatietopalvelu (services)<\/p>\r\n<h3><a id="topicCategory_annex" name="topicCategory_annex"><\/a>2. AIHELUOKKA STANDARDIN EN ISO 19115 MUKAISESTI<\/h3>\r\n<p>2.1 Maatalous (farming)<\/p><p>Kotiel\xE4inten kasvatus ja/tai kasvinviljely.<\/p><p>Luokka koskee direktiivin 2007/2/EY liitteen III kohdan 9 paikkatietoaihetta "Maatalous- ja vesiviljelylaitokset".<\/p><p>2.2 El\xE4in- ja kasvikunta (biota)<\/p><p>Kasvisto ja el\xE4imist\xF6 luonnonymp\xE4rist\xF6ss\xE4.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen III paikkatietoaiheita: kohta 17 "Biomaantieteelliset alueet", kohta 18 "Elinymp\xE4rist\xF6t ja biotoopit", kohta 19 "Lajien levinneisyys".<\/p><p>2.3 Rajat (boundaries)<\/p><p>Lakis\xE4\xE4teiset maan alueiden kuvaukset.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteiden paikkatietoaiheita: liitteen I kohta 4 "Hallinnolliset yksik\xF6t", liitteen III kohta 1 "Tilastoyksik\xF6t".<\/p><p>2.4 Ilmastotiede/meteorologia/ilmakeh\xE4 (climatologyMeteorologyAtmosphere)<\/p><p>Ilmakeh\xE4n prosessit ja ilmi\xF6t.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen III paikkatietoaiheita: kohta 13 "Ilmakeh\xE4n tila", kohta 14 "Ilmaston maantieteelliset ominaispiirteet".<\/p><p>2.5 Talous (economy)<\/p><p>Taloudellinen toimeliaisuus, taloudelliset olot ja ty\xF6llisyys.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen III paikkatietoaiheita: kohta 20 "Energiavarat", kohta 21 "Mineraalivarat".<\/p><p>2.6 Korkeus (elevation)<\/p><p>Korkeus tai syvyys merenpinnasta.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen II paikkatietoaiheita: kohta 1 "Korkeus".<\/p><p>2.7 Ymp\xE4rist\xF6 (environment)<\/p><p>Luonnonvarat, luonnonsuojelu ja ymp\xE4rist\xF6nsuojelu.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen I paikkatietoaiheita: kohta 9 "Suojellut alueet".<\/p><p>2.8 Geotieteet (geoscientificInformation)<\/p><p>Geotieteisiin liittyv\xE4\xE4 informaatiota.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY paikkatietoaiheita: liitteen III kohta 3 "Maaper\xE4", liitteen II kohta 4 "Geologia", liitteen III kohta 12 "Luonnonriskialueet".<\/p><p>2.9 Terveys (health)<\/p><p>Terveys, terveyspalvelut, sosiaaliekologia ja turvallisuus.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen III paikkatietoaiheita: kohta 5 "V\xE4est\xF6n terveys ja turvallisuus".<\/p><p>2.10 Kuvat/peruskartat/maanpeite (imageryBaseMapsEarthCover)<\/p><p>Peruskartat.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen II paikkatietoaiheita: kohta 3 "Ortoilmakuvat", kohta 2 "Maanpeite".<\/p><p>2.11 Tiedustelu/puolustus (intelligenceMilitary)<\/p><p>Sotilastukikohdat, puolustusrakenteet, sotilastoiminta.<\/p><p>Ei koske erityisesti mit\xE4\xE4n direktiivin 2007/2/EY paikkatietoaiheita.<\/p><p>2.12 Sis\xE4vedet (inlandWaters)<\/p><p>Sis\xE4vesikohteet, valumaj\xE4rjestelm\xE4t ja niiden ominaispiirteet.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen I paikkatietoaiheita: kohta 8 "Hydrografia".<\/p><p>2.13 Sijainti (location)<\/p><p>Paikantamiseen liittyv\xE4 tieto tai palvelu.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen I paikkatietoaiheita: kohta 3 "Paikannimet", kohta 5 "Osoitteet".<\/p><p>2.14 Valtameret (oceans)<\/p><p>Suolaisten vesimassojen (lukuun ottamatta sis\xE4vesi\xE4) ominaispiirteet.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen III paikkatietoaiheita: kohta 16 "Merialueet", kohta 15 "Merentutkimuksen maantieteelliset ominaispiirteet".<\/p><p>2.15 Aluesuunnittelu/kiinteist\xF6j\xE4rjestelm\xE4 (planningCadastre)<\/p><p>Maan k\xE4ytt\xF6\xF6n ja suunnitteluun liittyv\xE4\xE4 informaatiota.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY paikkatietoaiheita: liitteen I kohta 6 "Kiinteist\xF6t", liitteen III kohta 4 "Maank\xE4ytt\xF6", liitteen III kohta 11 "Aluesuunnittelun, rajoitusten ja s\xE4\xE4ntelyn piiriin kuuluvat alueet ja raportointiyksik\xF6t".<\/p><p>2.16 Yhteiskunta (society)<\/p><p>Yhteiskuntaa ja kulttuuria kuvaavat ominaispiirteet.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen III paikkatietoaiheita: kohta 10 "V\xE4est\xF6jakauma \u2013 demografia".<\/p><p>2.17 Rakennelma (structure)<\/p><p>Keinotekoiset rakenteet.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen III paikkatietoaiheita: kohta 2 "Rakennukset", kohta 8 "Tuotanto- ja teollisuuslaitokset", kohta 7 "Ymp\xE4rist\xF6n tilan seurantalaitteet".<\/p><p>2.18 Liikenne (transportation)<\/p><p>Ihmisten ja tavaroiden kuljetukseen k\xE4ytetyt tavat.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen I paikkatietoaiheita: kohta 7 "Liikenneverkot".<\/p><p>2.19 Johtoverkot/viestint\xE4 (utilitiesCommunication)<\/p><p>Energia-, vesi- ja j\xE4tej\xE4rjestelm\xE4t sek\xE4 viestint\xE4infrastruktuuri ja -palvelut.<\/p><p>Luokka koskee seuraavia direktiivin 2007/2/EY liitteen III paikkatietoaiheita: kohta 6 "Yleishy\xF6dylliset ja muut julkiset palvelut".<\/p>\r\n<h3>3. PAIKKATIETOPALVELUTYYPPI<\/h3>\r\n<p>3.1 Hakupalvelu (discovery)<\/p><p>Palvelu, joka mahdollistaa paikkatietoaineistojen ja -palvelujen etsimisen niiden metatietojen perusteella sek\xE4 metatiedon sis\xE4ll\xF6n tarkastelun.<\/p><p>3.2 Katselupalvelu (view)<\/p><p>Palvelu, joka mahdollistaa v\xE4hint\xE4\xE4n paikkatietoaineistojen tarkastelun, liikkumisen aineistossa, katselumittakaavan muuttamisen, panoroinnin tai peittokuvat sek\xE4 selitetiedon ja metatietoon sis\xE4ltyv\xE4n kaikenlaisen merkityksellisen tiedon katselun n\xE4yt\xF6ll\xE4.<\/p><p>3.3 Latauspalvelu (download)<\/p><p>Palvelu, joka mahdollistaa paikkatietoaineistojen ja niiden osien kopioinnin omalle tietokoneelle ja, mahdollisuuksien mukaan, suoran p\xE4\xE4syn niihin.<\/p><p>3.4 Muunnospalvelu (transformation)<\/p><p>Palvelu, joka mahdollistaa paikkatietoaineistojen muuntamisen yhteentoimivuuden saavuttamiseksi.<\/p><p>3.5 Prosessigenerointipalvelu (invoke)<\/p><p>Palvelu, joka mahdollistaa sek\xE4 paikkatietopalvelun edellytt\xE4mien sy\xF6tteiden ja tulosteiden ett\xE4 useampia palveluja yhdist\xE4vien prosessien tai palveluketjujen m\xE4\xE4ritt\xE4misen. Se mahdollistaa my\xF6s prosessin tai palveluketjun ulkoisen verkkopalvelurajapinnan m\xE4\xE4ritt\xE4misen.<\/p><p>3.6 Muu palvelu (other)<\/p>\r\n<h3>4. PAIKKATIETOPALVELUJEN LUOKITTELU<\/h3>\r\n<p>Avainsanat perustuvat standardin EN ISO 19119 mukaiseen maantieteellisten palvelujen luokitteluun. Luokittelussa luokat jakautuvat alaluokkiin, joilla m\xE4\xE4ritell\xE4\xE4n paikkatietopalvelujen luokittelun arvoalue.<\/p><p>100 K\xE4ytt\xF6liittym\xE4palvelut (humanInteractionService)<\/p><p>T\xE4h\xE4n luokkaan kuuluvat seuraavat alaluokat:<\/p><p>101. Hakemistoselain (humanCatalogueViewer)<\/p><p>Selainpalvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi tarkastella hakemistoa ja paikantaa, selailla ja hallita metatietoa paikkatiedosta tai paikkatietopalveluista.<\/p><p>102. Paikkatietoselain (humanGeographicViewer)<\/p><p>Selainpalvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi tarkastella yh\xE4 tai useampaa tietokohdekokoelmaa tai paikkatietojakaumaa.<\/p><p>103. Maantieteellinen taulukkolaskentaselain (humanGeographicSpreadsheetViewer)<\/p><p>Selainpalvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi tarkastella kerrallaan useita dataobjekteja ja teett\xE4\xE4 paikkatiedolla laskelmia, jotka muistuttavat taulukkolaskentaohjelmalla teht\xE4vi\xE4 laskelmia.<\/p><p>104. Palvelueditori (humanServiceEditor)<\/p><p>Editoripalvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi hallita paikkatiedon prosessointipalveluja.<\/p><p>105. Palveluketjueditori (humanChainDefinitionEditor)<\/p><p>Editoripalvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi hallita palveluketjupalvelua.<\/p><p>106. Prosessins\xE4\xE4t\xF6ohjain (humanWorkflowEnactmentManager)<\/p><p>Palvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi hallita prosessinohjauspalvelua.<\/p><p>107. Kohdetietoeditori (humanGeographicFeatureEditor)<\/p><p>Paikkatietoeditori, jonka avulla k\xE4ytt\xE4j\xE4 voi k\xE4sitell\xE4 kohdetietoa.<\/p><p>108. Symbolieditori (humanGeographicSymbolEditor)<\/p><p>Editoripalvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi valita ja hallinnoida symbolikirja');
  $append_0(builder.data_0, 'stoja.<\/p><p>109. Yleistyseditori (humanFeatureGeneralizationEditor)<\/p><p>Editoripalvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi muokata tietokohteen tai tietokohdekokoelman kartografista ilmentym\xE4\xE4 yksinkertaistamalla sen visualisointia menett\xE4m\xE4tt\xE4 kuitenkaan sen p\xE4\xE4piirteit\xE4.<\/p><p>110. Paikkatiedon tietorakenteen selain (humanGeographicDataStructureViewer)<\/p><p>Selainpalvelu, jonka avulla k\xE4ytt\xE4j\xE4 voi tarkastella osaa tietoaineistosta n\xE4hd\xE4kseen sen sis\xE4isen rakenteen.<\/p><p>200 Tiedonhallintapalvelut (infoManagementService)<\/p><p>T\xE4h\xE4n luokkaan kuuluvat seuraavat alaluokat:<\/p><p>201. Tietokohdepalvelu (infoFeatureAccessService)<\/p><p>Palvelu, jonka avulla asiakassovellus voi tarkastella ja hallinnoida tietokohdekokonaisuutta.<\/p><p>202. Karttakuvapalvelu (infoMapAccessService)<\/p><p>Palvelu, jonka avulla asiakassovellus voi k\xE4ytt\xE4\xE4 maantieteellist\xE4 grafiikkaa eli kuvia paikkatiedosta.<\/p><p>203. Jatkumotietopalvelu (infoCoverageAccessService)<\/p><p>Palvelu, jonka avulla asiakassovellus voi tarkastella ja hallinnoida jatkumomuotoisen tiedon kokonaisuutta.<\/p><p>204. Havaintolaitetietopalvelu (infoSensorDescriptionService)<\/p><p>Palvelu, joka antaa tiedot havaintolaitteesta, muun muassa tiedot sen sijainnista ja suuntauksesta sek\xE4 geometrisist\xE4, dynaamisista ja radiometrisist\xE4 ominaisuuksista geoprosessointitarkoituksiin.<\/p><p>205. Tietotuotepalvelu (infoProductAccessService)<\/p><p>Palvelu, jonka avulla voi saada k\xE4ytt\xF6\xF6ns\xE4 paikkatietotuotevalikoiman ja hallinnoida sit\xE4.<\/p><p>206. Tietokohdetyyppipalvelu (infoFeatureTypeService)<\/p><p>Palvelu, jonka avulla asiakassovellus voi tarkastella ja hallinnoida tietokohdetyyppien m\xE4\xE4ritelmien valikoimaa.<\/p><p>207. Luettelopalvelu (infoCatalogueService)<\/p><p>Palvelu, jonka avulla voi tehd\xE4 hakuja ilmentymi\xE4 koskevaan metadatakokonaisuuteen ja hallinnoida sit\xE4.<\/p><p>208. Rekisteripalvelu (infoRegistryService)<\/p><p>Palvelu, jonka avulla p\xE4\xE4see tarkastelemaan tietokohteiden tyyppej\xE4 koskevaa metatietoa.<\/p><p>209. Maantieteellinen hakemistopalvelu (infoGazetteerService)<\/p><p>Palvelu, joka tarjoaa luettelon reaalimaailman ilmi\xF6luokan tai -luokkien ilmentymist\xE4, joihin sis\xE4ltyy jonkinlaista sijaintia koskevaa tietoa.<\/p><p>210. Tilaamispalvelu (infoOrderHandlingService)<\/p><p>Palvelu, jonka avulla asiakas voi tilata tuotteita palveluntarjoajalta.<\/p><p>211. Kestotilauspalvelu (infoStandingOrderService)<\/p><p>Tilaamispalvelu, jonka kautta k\xE4ytt\xE4j\xE4 voi pyyt\xE4\xE4, ett\xE4 tietty\xE4 maantieteellist\xE4 aluetta koskeva tuote toimitetaan aina sen tullessa saataville.<\/p><p>300 Prosessinhallintapalvelut (taskManagementService)<\/p><p>T\xE4h\xE4n luokkaan kuuluvat seuraavat alaluokat:<\/p><p>301. Palveluketjun m\xE4\xE4rittelypalvelu (chainDefinitionService)<\/p><p>Palvelu, jonka avulla m\xE4\xE4ritet\xE4\xE4n k\xE4sittelyketju ja mahdollistetaan sen suorittaminen prosessinohjauspalvelussa.<\/p><p>302. Prosessinohjauspalvelu (workflowEnactmentService)<\/p><p>Prosessinohjauspalvelu tulkitsee ketjun sek\xE4 ohjaa palvelujen ilmentymien tuottamista ja toimintojen jaksottamista.<\/p><p>303. Tilauspalvelu (subscriptionService)<\/p><p>Palvelu, jonka avulla asiakassovellus voi rekister\xF6ity\xE4 tilaajaksi tietynlaista tapahtumaa koskeville ilmoituksille.<\/p><p>400 Paikkatiedon sijaintiprosessointipalvelut (spatialProcessingService)<\/p><p>T\xE4h\xE4n luokkaan kuuluvat seuraavat alaluokat:<\/p><p>401. Koordinaattikonversiopalvelu (spatialCoordinateConversionService)<\/p><p>Palvelu, jolla muunnetaan koordinaatteja kahden samaan datumiin perustuvan koordinaattij\xE4rjestelm\xE4n v\xE4lill\xE4.<\/p><p>402. Koordinaattimuunnospalvelu (spatialCoordinateTransformationService)<\/p><p>Palvelu, jolla muunnetaan koordinaatteja kahden eri datumiin perustuvan koordinaattij\xE4rjestelm\xE4n v\xE4lill\xE4.<\/p><p>403. Jatkumo/vektorikonversiopalvelu (spatialCoverageVectorConversionService)<\/p><p>Palvelu, jolla paikkatiedon kuvaus muutetaan jatkumomuotoisesta skeemasta vektoriskeemaan tai p\xE4invastoin.<\/p><p>404. Kuvakoordinaattikonversiopalvelu (spatialImageCoordinateConversionService)<\/p><p>Koordinaattien muunnos- tai konversiopalvelu, jolla muutetaan kuvan koordinaattij\xE4rjestelm\xE4.<\/p><p>405. Oikaisupalvelu (spatialRectificationService)<\/p><p>Palvelu, jolla kuva muunnetaan kohtisuoraan yhdensuuntaisprojektioon ja n\xE4in ollen vakiomittakaavaan.<\/p><p>406. Ortokorjauspalvelu (spatialOrthorectificationService)<\/p><p>Oikaisupalvelu, joka poistaa kuvasta maankohoumista johtuvan vinoutuman ja v\xE4\xE4ristymisen.<\/p><p>407. Havaintolaitegeometriamallia k\xE4ytt\xE4v\xE4 oikaisupalvelu (spatialSensorGeometryModelAdjustmentService)<\/p><p>Palvelu, joka k\xE4ytt\xE4\xE4 havaintolaitteen geometriamallia kuvan sovittamiseksi paremmin muihin kuviin ja/tai tunnettuihin sijaintipisteisiin maassa.<\/p><p>408. Kuvageometrian konversiopalvelu (spatialImageGeometryModelConversionService)<\/p><p>Palvelu, joka muuntaa kuvauslaitteen geometriamallin toiseksi mutta vastaavaksi geometriamalliksi.<\/p><p>409. Alueperusteinen osittamispalvelu (spatialSubsettingService)<\/p><p>Palvelu, joka seuloo osan yhten\xE4ist\xE4 aluetta koskevasta l\xE4ht\xF6tiedosta joko maantieteellisen sijainnin tai ruudustokoordinaattien perusteella.<\/p><p>410. N\xE4ytteenottopalvelu (spatialSamplingService)<\/p><p>Palvelu, joka seuloo l\xE4ht\xF6tietoa jatkuvana otantana joko maantieteellisen sijainnin tai ruudustokoordinaattien perusteella.<\/p><p>411. Aluejakopalvelu (spatialTilingChangeService)<\/p><p>Palvelu, joka muuttaa paikkatiedon ruutumaista aluejakoa.<\/p><p>412. Ulottuvuuksienmittauspalvelu (spatialDimensionMeasurementService)<\/p><p>Palvelu, jonka avulla voidaan m\xE4\xE4ritt\xE4\xE4 kuvassa tai muussa paikkatiedossa esiintyv\xE4n kohteen ulottuvuudet.<\/p><p>413. Tietokohteen muokkauspalvelu (spatialFeatureManipulationService)<\/p><p>Rekister\xF6i tietokohteen toiseksi tietokohteeksi, kuvaksi tai muuksi tietoaineistoksi tai koordinaattikokonaisuudeksi; korjaa suhteellisen muunnoksen v\xE4\xE4ristymi\xE4, kierrosta aiheutuvia eroja, mittakaavaeroja ja perspektiivieroja. Tarkastaa, ett\xE4 tietokohdekokoelman kaikki kohteet ovat topologisesti eheit\xE4 tietokohdekokoelman topologias\xE4\xE4nt\xF6jen mukaisesti sek\xE4 tunnistaa tai korjaa todetut ep\xE4johdonmukaisuudet.<\/p><p>414. Tietokohteiden vastaavuuspalvelu (spatialFeatureMatchingService)<\/p><p>Palvelu, joka m\xE4\xE4rittelee, mitk\xE4 eri tietol\xE4hteist\xE4 per\xE4isin olevat tietokohteet tai niiden osat liittyv\xE4t samaan reaalimaailman kohteeseen (esim. reunavertailussa ja rajoitetussa koostamisessa).<\/p><p>415. Tietokohteiden yleist\xE4mispalvelu (spatialFeatureGeneralizationService)<\/p><p>Palvelu, joka v\xE4hent\xE4\xE4 spatiaalista variaatiota tietokohdekokoelmassa sen havainnollisuuden parantamiseksi samalla ehk\xE4isten datan v\xE4hent\xE4misen kielteisi\xE4 vaikutuksia.<\/p><p>416. Reitinm\xE4\xE4rityspalvelu (spatialRouteDeterminationService)<\/p><p>Palvelu, joka m\xE4\xE4rittelee optimaalisen reitin kahden pisteen v\xE4lill\xE4 sy\xF6teparametrien ja tietokohdekokoelman sis\xE4lt\xE4mien ominaisuuksien perusteella.<\/p><p>417. Paikantamispalvelu (spatialPositioningService)<\/p><p>Paikantamista tarjoavan laitteen tarjoama palvelu, jonka avulla voi k\xE4ytt\xE4\xE4, hankkia ja yksiselitteisesti tulkita sijaintitietoa, sek\xE4 p\xE4\xE4tell\xE4, vastaavatko tulokset k\xE4ytt\xF6tarkoituksen vaatimuksia.<\/p><p>418. L\xE4heisyysanalyysipalvelu (spatialProximityAnalysisService)<\/p><p>Etsii kaikki tietyt attribuutit omaavat objektit, jotka sijaitsevat k\xE4ytt\xE4j\xE4n m\xE4\xE4rittelem\xE4n et\xE4isyyden sis\xE4ll\xE4 tietyst\xE4 sijaintipisteest\xE4 tai paikkatietokohteesta.<\/p><p>500 Paikkatiedon temaattiset prosessointipalvelut (thematicProcessingService)<\/p><p>T\xE4h\xE4n luokkaan kuuluvat seuraavat alaluokat:<\/p><p>501. Maantieteellisten muuttujien laskentapalvelu (thematicGoparameterCalculationService)<\/p><p>Palvelu, joka tuottaa sovelluskohtaisia kvantitatiivisia tuloksia, joita ei voi saada suoraan raakadatasta.<\/p><p>502. Teemaperusteinen luokittelupalvelu (thematicClassificationService)<\/p><p>Palvelu, joka luokittelee paikkatietoa alueittain temaattisten attribuuttien perusteella.<\/p><p>503. Tietokohteiden yleist\xE4mispalvelu (thematicFeatureGeneralizationService)<\/p><p>Palvelu, joka yleist\xE4\xE4 tietokohteita tietokohdekokoelmassa sen havainnollisuuden parantamiseksi samalla ehk\xE4isten datan v\xE4hent\xE4misen kielteisi\xE4 vaikutuksia.<\/p><p>504. Teemaperusteinen osittamispalvelu (thematicSubsettingService)<\/p><p>Palvelu, joka seuloo osan yhten\xE4ist\xE4 aluetta koskevasta l\xE4ht\xF6tiedosta temaattisten parametriarvojen perusteella.<\/p><p>505. Lukum\xE4\xE4r\xE4laskentapalvelu (thematicSpatialCountingService)<\/p><p>Palvelu, joka laskee teemaperusteisesti paikkatietokohteiden m\xE4\xE4ri\xE4.<\/p><p>506. Muutosj\xE4ljityspalvelu (thematicChangeDetectionService)<\/p><p>Palvelu, jolla etsit\xE4\xE4n eroja samaa maantieteellist\xE4 aluetta eri aikoina kuvaavan kahden tietoaineiston v\xE4lill\xE4.<\/p><p>507. Paikkatietokohteiden tunnistuspalvelu (thematicGeographicInformationExtractionService)<\/p><p>Palvelu, joka tukee tietokohteiden ja maaston tunnistamista kaukokartoitusaineistosta ja skannatuista kuvista.<\/p><p>508. Kuvank\xE4sittelypalvelu (thematicImageProcessingService)<\/p><p>Palvelu, jolla voidaan muuttaa kuvan temaattisia attribuutteja matemaattisen mallin avulla.<\/p><p>509. Erotuskyvyn alentamispalvelu (thematicReducedResolutionGenerationService)<\/p><p>Palvelu, joka heikent\xE4\xE4 kuvan erotuskyky\xE4.<\/p><p>510. Kuvans\xE4\xE4t\xF6palvelu (thematicImageManipulationService)<\/p><p>Palvelut, joilla muokataan kuvadatan ominaisuuksia: v\xE4ri- ja kontrastiarvojen muuttaminen, erilaisten suotimien k\xE4ytt\xF6, kuvan resoluution muokkaaminen, h\xE4iri\xF6npoisto, raitaisuuden v\xE4hent\xE4minen, systemaattis-radiometriset korjaukset, ilmakeh\xE4n aiheuttama heikentyminen, muutokset valoisuusolosuhteissa jne.<\/p><p>511. Kuvatulkintapalvelut (thematicImageUnderstandingService)<\/p><p>Palvelut, jotka mahdollistavat automaattisen kuvaerojen j\xE4ljityksen, kuvaerojen rekister\xF6innin, erojen merkityksen analysoinnin ja esitt\xE4misen sek\xE4 aluepohjaisen ja mallipohjaisen differentioinnin.<\/p><p>512. Kuvasynteesipalvelut (thematicImageSynthesisService)<\/p><p>Palvelut, joita k\xE4ytet\xE4\xE4n kuvien luontiin tai muokkaamiseen tietokonepohjaisten tilamallien avulla, perspektiivimuunnoksiin sek\xE4 kuvan ominaisuuksien muokkaamiseen n\xE4kyvyyden parantamiseksi, erotuskyvyn lis\xE4\xE4miseksi ja/tai pilvipeitteen tai sumuisuuden vaikutusten v\xE4hent\xE4miseksi.<\/p><p>513. Monikanavakuvan muokkauspalvelu (thematicMultibandImageManipulationService)<\/p><p>Palvelut, jotka muokkaavat kuvaa k\xE4ytt\xE4m\xE4ll\xE4 sen eri kanavia.<\/p><p>514. Kohdetunnistuspalvelu (thematicObjectDetectionService)<\/p><p>Palvelut, joilla kuvasta etsit\xE4\xE4n reaalimaailman kohteita.<\/p><p>515. Geoseulontapalvelu (thematicGeoparsingService)<\/p><p>Palvelu, joka seuloo tekstist\xE4 sijaintiviittauksia, kuten paikannimi\xE4, osoitteita, postinumeroita jne. geokoodauspalvelussa k\xE4ytett\xE4viksi.<\/p><p>516. Geokoodauspalvelu (thematicGeocodingService)<\/p><p>Palvelu, jolla liitet\xE4\xE4n tekstimuotoisiin sijaintiviittauksiin maantieteelliset koordinaatit (tai joku muu sijaintiviite).<\/p><p>600 Paikkatiedon ajalliset prosessointipalvelut (temporalProcessingService)<\/p><p>T\xE4h\xE4n luokkaan kuuluvat seuraavat alaluokat:<\/p><p>601. Aikaviitej\xE4rjestelm\xE4n muuntopalvelu (temporalReferenceSystemTransformationService)<\/p><p>Palvelu, jolla muutetaan aikam\xE4\xE4reilmentym\xE4 yhdest\xE4 aikaviitej\xE4rjestelm\xE4st\xE4 toiseen aikaviitej\xE4rjestelm\xE4\xE4n.<\/p><p>602. Aikajaksotuspalvelu (temporalSubsettingService)<\/p><p>Palvelu, joka seuloo dataa sy\xF6tteest\xE4 jatkuvaan aikajaksotukseen ajallisen sijoittumisen perusteella.<\/p><p>603. N\xE4ytteenottopalvelu (temporalSamplingService)<\/p><p>Palvelu, joka seuloo l\xE4ht\xF6tietoa jatkuvana otantana ajallisen sijoittumisen perusteella.<\/p><p>604. Aikaperusteinen l\xE4heisyysanalyysipalvelu (temporalProximityAnalysisService)<\/p><p>Etsii kaikki tietyt attribuutit omaavat objektit, jotka sijaitsevat k\xE4ytt\xE4j\xE4n m\xE4\xE4rittelem\xE4n aikav\xE4lin sis\xE4ll\xE4 tietyst\xE4 aikav\xE4list\xE4 tai ajankohdasta.<\/p><p>700 Paikkatiedon metatietoa koskevat prosessointipalvelut (metadataProcessingService)<\/p><p>T\xE4h\xE4n luokkaan kuuluvat seuraavat alaluokat:<\/p><p>701. Tilastonlaskentapalvelu (metadataStatisticalCalculationService)<\/p><p>Palvelu, jolla luodaan tilasto tietyst\xE4 tietoaineistosta.<\/p><p>702. Maantieteelliset annotointipalvelut (metadataGeographicAnnotationService)<\/p><p>Palvelut, joilla liitet\xE4\xE4n lis\xE4tietoa kuvaan tai tietokohdekokoelman tietokohteeseen.<\/p><p>800 Paikkatietoa koskevat tiedonv\xE4lityspalvelut (comService)<\/p><p>T\xE4h\xE4n luokkaan kuuluvat seuraavat alaluokat:<\/p><p>801. Koodauspalvelu (comEncodingService)<\/p><p>Palvelu, joka soveltaa koodauss\xE4\xE4nt\xF6\xE4 ja tarjoaa rajapinnan koodaus- ja koodauksenpurkutoimintoihin.<\/p><p>802. Tiedonsiirtopalvelu (comTransferService)<\/p><p>Palvelu, joka yht\xE4 tai useampaa yhteysk\xE4yt\xE4nt\xF6\xE4 k\xE4ytt\xE4en toteuttaa tiedonsiirron hajautettujen tietoj\xE4rjestelmien v\xE4lill\xE4 verkon v\xE4lityksell\xE4 tai tallennusv\xE4lineell\xE4.<\/p><p>803. Tiivistyspalvelu (comGeographicCompressionService)<\/p><p>Palvelu, joka muuttaa tietokohdekokoelman tiivistettyyn muotoon ja takaisin.<\/p><p>804. Formaatinmuuntopalvelu (comGeographicFormatConversionService)<\/p><p>Palvelu, joka muuntaa tietoa yhdest\xE4 paikkatietoformaatista toiseen.<\/p><p>805. Viestint\xE4palvelu (comMessagingService)<\/p><p>Palvelu, jonka avulla useat k\xE4ytt\xE4j\xE4t voivat samanaikaisesti tarkastella ja kommentoida tietokohdekokoelmia ja tehd\xE4 niit\xE4 koskevia muutospyynt\xF6j\xE4.<\/p><p>806. Ulkoisten tiedostojen ja ohjelmien hallinta (comRemoteFileAndExecutableManagement)<\/p><p>Palvelu, joka mahdollistaa paikkatietokohteita sis\xE4lt\xE4v\xE4n ulkoisen aineistopalvelimen k\xE4yt\xF6n niin, ett\xE4 se n\xE4kyy asiakassovellukselle paikallisena.<\/p>\r\n<h3>5. S\xC4\xC4NT\xD6JENMUKAISUUS<\/h3>\r\n<p>5.1 S\xE4\xE4nt\xF6jen mukainen (conformant)<\/p><p>Resurssi on kaikilta osin mainitun eritelm\xE4n mukainen.<\/p><p>5.2 Ei s\xE4\xE4nt\xF6jen mukainen (notConformant)<\/p><p>Resurssi ei ole mainitun eritelm\xE4n mukainen.<\/p><p>5.3 Ei arvioitu (notEvaluated)<\/p><p>S\xE4\xE4nt\xF6jenmukaisuutta ei ole arvioitu.<\/p>\r\n<h3>6. VASTUUTAHON ROOLI<\/h3>\r\n<p>6.1 Resurssin tarjoaja (resourceProvider)<\/p><p>Taho, jolta resurssi on saatavissa.<\/p><p>6.2 Haltija (custodian)<\/p><p>Taho, joka on vastuussa tiedosta ja varmistaa resurssin asianmukaisen hoidon ja yll\xE4pidon.<\/p><p>6.3 Omistaja (owner)<\/p><p>Taho, joka omistaa resurssin.<\/p><p>6.4 K\xE4ytt\xE4j\xE4 (user)<\/p><p>Taho, joka k\xE4ytt\xE4\xE4 resurssia.<\/p><p>6.5 Jakelija (distributor)<\/p><p>Taho, joka jakelee resurssia.<\/p><p>6.6 Tuottaja (originator)<\/p><p>Taho, joka on luonut resurssin.<\/p><p>6.7 Yhteystaho (pointOfContact)<\/p><p>Taho, jolta saa tietoa resurssista tai sen hankinnasta.<\/p><p>6.8 P\xE4\xE4hankkija (principalInvestigator)<\/p><p>Taho, joka suurimmalta osin vastaa tiedon keruusta ja tutkimuksesta.<\/p><p>6.9 K\xE4sittelij\xE4 (processor)<\/p><p>Taho, joka on muokannut tietoa niin, ett\xE4 resurssi on muuttunut.<\/p><p>6.10 Julkaisija (publisher)<\/p><p>Taho, joka on julkaissut resurssin.<\/p><p>6.11 Laatija (author)<\/p><p>Taho, joka on laatinut resurssin.<\/p><p>--------------------------------------------------<\/p>\r\n<\/div>\r\n<hr class="homepage"><div id="managed"><a href="http://publications.europa.eu">Yll\xE4pito: julkaisutoimisto<\/a><\/div><\/body>\r\n<\/html>\r\n');
  return $toString_1(builder.data_0);
